package conceptbased;

public class wrapperclass_autoboxing {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String name="Barbie";
		Integer date=12;
		Integer month=12;
		Integer year=2000;
		float height=166.5f;
		
		System.out.println("person name is="+name);
		System.out.println("person birth details="+date+" "+month+" "+year+" ");
		System.out.println("person height="+height);
		

	}

}
